exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.aixs.la/xs/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,[/<ul id="listsss">\s*(?<fragment>(?:<div[^>]*>(\s*<li[^>]*>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)*\s*<\/div>)+)/,/<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)<\/a>/g],{clientOptions:{...(options&&options.clientOptions)},transformer:raw=>[...raw.matchAll(/<div data-id="(?<num>\d+)">(?<fragment>(?:\s*<li[^>]*>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)+)\s*<\/div>/g)].map(_=>[parseInt(_.groups.num),_.groups.fragment]).sort((a,b)=>a[0]-b[0]).map(_=>_[1]).join("")})};